// src/pages/Home.js
import React from 'react';
import Layout from '../components/Layout';

const Eventos = () => {
  return (
    <Layout>
      <section className="p-6">
        <h1 className="text-3xl font-bold">EVENTOS Page</h1>
        <p>EVENTOOS.</p>
      </section>
    </Layout>
  );
};

export default Eventos;
